ISLAMABAD, Jul 10 (APP):Chief Whip of Pakistan Tehreek-e-Insaf in the National Assembly Malik Muhammad Amir Dogar Friday called on President Dr Arif Alvi here.
During the meeting held at Aiwan-e-Sadr, they discussed the matters of mutual interest.
